import React from "react";
import brand from "../../../../Assets/img/brand.png";

let Footer : React.FC = () => {
    return(
        <React.Fragment>
            <section className="m-5 bg-footer">
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-md-6 footer-text">
                            <img src={brand} alt=""/>
                            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Accusamus at, cumque cupiditate doloremque harum impedit qui quidem sunt voluptate! Laborum.</p>
                        </div>
                        <div className="col-md-6"></div>
                    </div>
                </div>
            </section>
        </React.Fragment>
    )
}
export default Footer;
